export class User {
  constructor(id, login, firstName, lastName, address, phone, iban, bankname, bankaddress, email, loggedIn, points, agb) {
    this.id = id;
    this.login = login;
    this.firstName = firstName;
    this.lastName = lastName;
    this.address = address;
    this.phone = phone;
    this.iban = iban;
    this.bankname = bankname;
    this.bankaddress = bankaddress;
    this.email = email;
    this.loggedIn = loggedIn;
    this.points = points;
    this.agb = agb;
  }
}
export function getUserIdentifier(user) {
  return user.id;
}
